import { Link } from 'react-router-dom';

function Navbar() {
  const navbarLinks = [{ id: 1, name: 'Home', link: '/' }];
  return (
    <nav className="navbar">
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/favorites">Favorites</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
